import React from 'react';
import { Link } from 'react-router-dom';
import Header from '../components/Header';
import Badge from '../components/Badge';
import Badge2 from '../components/Badge2';
import Badge3 from '../components/Badge3';
import Badge4 from '../components/Badge4';
import BadgesBox from '../components/BadgesBox';
import data from '../components/info.json';
import Homes from '../components/Homes';
import './style/Badges.css';

class Badges extends React.Component {
  state = {
    data: {
      ...data
  }
};

render() {
  return (
      <React.Fragment>
            <div className="Badges">
                  <Header />
                
                 <div className="Badges__container" >
                     <div className="Badges__buttons" >
                     <Link to="/badges/second" className="btn btn-primary">
                       <h4>Más personajes</h4>
                     </Link>
                     </div>
                     <div className="Badges__boxing">
                       {this.state.data &&
                         <Badge key={this.id}
                         name={this.state.data.name}
                         old={this.state.data.old}
                         raza={this.state.data.raza}
                         />
                       }

                       <Badge2>
                       <BadgesBox />
                       </Badge2>

                       <Badge3>
                       {/* <BadgesBox /> */}
                       </Badge3>

                       <Badge4>
                       {/* <BadgesBox /> */}
                       </Badge4>
                     </div>
                     <center>
                       <h1>Autor@: Hanna Anaya</h1>
                       <br />
                       <h2>
                       <Link to=''>Mostrar Más</Link>
                       </h2>
                       </center>
                    
                     <br />
                     <div className="Badges__homes">
                     <h2>
                       Paisajes
                       <Link to=''>Mostrar Más</Link>
                       </h2>
                     </div>
                     <br />
                </div>
            </div>
      </React.Fragment>
    );
  }

    
}

export default Badges;
